import React, { useState } from "react";
import {
  Modal,
  ModalHeader,
  ModalBody,
  CardBody,
  Button,
  ModalFooter,
  Input
} from "reactstrap";

import { useModal } from "./../contexts/ModalContext";

const ModalEditInfo: React.FC = () => {
  const {
    showModalEditInfo,
    setShowModalEditInfo
  } = useModal();
  const toggle = () => setShowModalEditInfo(!showModalEditInfo);

  return (
    <Modal
      backdrop="static"
      isOpen={showModalEditInfo}
      centered
      toggle={toggle}
    >
      <ModalHeader toggle={toggle}>Edite informações...</ModalHeader>
      <ModalBody>
        <CardBody>
          Editar nome
          <Input placeholder="Nome"></Input>  
          Editar e-mail
          <Input className="mt-4" placeholder="E-mail"></Input>  

          <ModalFooter className="border-0">
            <Button color="default" onClick={toggle}>
              Close
            </Button>
            <Button color="primary">
              Confirmar
            </Button>
          </ModalFooter>
        </CardBody>
      </ModalBody>
    </Modal>
  );
};

export default ModalEditInfo;
